edition = "2023";

package youtube.api.innertube;

import "youtube/api/innertube/interstitial_pod_config.proto";
import "youtube/api/innertube/interstitial.proto";

option java_package = "com.google.protos.youtube.api.innertube";
option java_multiple_files = true;
option cc_enable_arenas = true;
option objc_class_prefix = "YTI";

message InterstitialPod {
	InterstitialPodConfig pod_config = 1;
	repeated Interstitial interstitials = 2;
}
